import React from 'react';

export default function Subscribe() {
  return (
    <div className="w-full max-w-screen-xl space-y-3 h-[300px] relative">
      {/* Background */}
      <div className="w-full h-full absolute bg-[#0594ff] rounded-[20px]" />
      
      {/* Content */}
      <div className="absolute left-[100px] top-[95px] text-[#fdfdff] text-5xl font-semibold leading-[56px]">
        Subscribe to get updated
      </div>
      <div className="absolute left-[100px] top-[175px] text-white text-lg font-light leading-[21px]">
        Warrant present garrets limited cordial in inquiry to. Supported me sweetness behaviour shameless excellent so arranging.
      </div>
      
      {/* Newsletter text */}
      <div className="absolute left-[100px] top-[61px] text-[#fdfdff] text-lg font-light">
        Newsletter
      </div>
      
      {/* Button */}
      <div className="w-[220px] h-[70px] absolute left-[958px] top-[115px]">
        <button className="w-full h-full absolute rounded-[10px] shadow-lg border border-white flex items-center justify-center">
          <a className="text-white text-base font-semibold">Get Started</a>
        </button>
      </div>
    </div>
  );
}
